const Phone = () => {

    const [phone, setPhone] = useState('')

    const handleChange = (event) => {
        setPhone(
            [event.target.value] = event.target.value
        )
    }


    return (

        <div>
            <label>
                Phone
                <input value={phone} onChange={() => handleChange()}>
                </input>
            </label>
        </div>

    )
}

export default Phone;
